func TestEmbeddings_First(t *testing.T) {
	t.Run("Ignore", func(t *testing.T) {
		e := IgnoredEmbeddings.First()

		assert.Len(t, e, len(IgnoredEmbeddings[0]))

		var norm float64
		for _, v := range e {
			norm += v * v
		}

		assert.InDelta(t, 1.0, math.Sqrt(norm), 1e-9)
	})
}

func TestEmbeddingsMidpoint(t *testing.T) {
	t.Run("TwoEmbeddingsOneDimension", func(t *testing.T) {
		e := Embeddings{Embedding{1}, Embedding{3}}

		result, r, c := EmbeddingsMidpoint(e)

		assert.Equal(t, Embedding{1}, result)
		assert.InDelta(t, 0.0, r, 1e-9)
		assert.Equal(t, 2, c)
	})
	t.Run("ThreeEmbeddingsOneDimension", func(t *testing.T) {
		e := Embeddings{Embedding{1}, Embedding{3}, Embedding{4}}

		result, r, c := EmbeddingsMidpoint(e)

		assert.Equal(t, Embedding{1}, result)
		assert.InDelta(t, 0.0, r, 1e-9)
		assert.Equal(t, 3, c)
	})
	t.Run("FourEmbeddingsOneDimension", func(t *testing.T) {
		e := Embeddings{Embedding{1}, Embedding{3}, Embedding{4}, Embedding{8}}

		result, r, c := EmbeddingsMidpoint(e)

		assert.Equal(t, Embedding{1}, result)
		assert.InDelta(t, 0.0, r, 1e-9)
		assert.Equal(t, 4, c)
	})
	t.Run("EmptyEmbedding", func(t *testing.T) {
		e := Embeddings{}

		result, r, c := EmbeddingsMidpoint(e)

		assert.Len(t, result, 0)
		assert.Equal(t, float64(0), r)
		assert.Equal(t, 0, c)
	})
	t.Run("EmbeddingWithDifferentLength", func(t *testing.T) {
		e := Embeddings{Embedding{1}, Embedding{3, 5}}

		result, r, c := EmbeddingsMidpoint(e)

		assert.Equal(t, Embedding{1}, result)
		assert.Equal(t, 2.01, r)
		assert.Equal(t, 2, c)
	})
	t.Run("Vectors", func(t *testing.T) {
		e := Embeddings{Embedding{1, 0, 0, 0}, Embedding{0, 1, 0, 0}, Embedding{0, 0, 1, 0}, Embedding{0, 0, 0, 1}}

		result, radius, count := EmbeddingsMidpoint(e)

		assert.Equal(t, Embedding{0.5, 0.5, 0.5, 0.5}, result)
		assert.InDelta(t, 1.01, radius, 1e-6)
		assert.Equal(t, 4, count)
	})

	t.Run("NormalizedResult", func(t *testing.T) {
		e := Embeddings{
			Embedding{1, 0, 0, 0},
			Embedding{0.9238795, 0.3826834, 0, 0},
		}

		result, _, count := EmbeddingsMidpoint(e)
		assert.Equal(t, 2, count)

		var sum float64
		for _, v := range result {
			sum += v * v
		}

		assert.InDelta(t, 1.0, math.Sqrt(sum), 1e-9)
	})
}

func TestUnmarshalEmbeddings(t *testing.T) {
	t.Run("Ok", func(t *testing.T) {
		emb, err := UnmarshalEmbeddings("[[-0.013,-0.031]]")

		assert.NoError(t, err)
		require.Len(t, emb, 1)
		require.Len(t, emb[0], 2)

		var norm float64
		for _, v := range emb[0] {
			norm += v * v
		}

		assert.InDelta(t, 1.0, math.Sqrt(norm), 1e-9)
		assert.Less(t, emb[0][0], 0.0)
		assert.Less(t, emb[0][1], 0.0)
	})
	t.Run("NoPrefix", func(t *testing.T) {
		emb, err := UnmarshalEmbeddings("-0.013,-0.031]")

		assert.Error(t, err)
		assert.Nil(t, emb)
	})
	t.Run("InvalidValues", func(t *testing.T) {
		emb, err := UnmarshalEmbeddings("[[true, false]]")

		assert.Error(t, err)
		assert.Equal(t, Embeddings{{0, 0}}, emb)
	})
}

var (
	benchmarkMidpoint Embedding
	benchmarkRadius   float64
)

func BenchmarkEmbeddingsMidpoint(b *testing.B) {
	b.Helper()

	emb := RandomEmbeddings(128, RegularFace)

	b.ReportAllocs()

	for b.Loop() {
		var count int
		benchmarkMidpoint, benchmarkRadius, count = EmbeddingsMidpoint(emb)
		if count == 0 {
			b.Fatal("no embeddings")
		}
	}
}
